import React, { useState, useContext } from "react";
import { UserContext } from '../context/UserContext';

function Login() {
  const [lecturerData, setLecturerData] = useState(null);
  const [lecturerRole, setlecturerRole] = useState(false);
  const [studentData, setStudentData] = useState(null);
  const [studentRole, setStudentRole] = useState(false);
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");

  const { login } = useContext(UserContext);
  // const [name, setName] = useState();

  async function handleSubmit(e) {
    e.preventDefault();

    console.log(JSON.stringify({ username, password }));

    login(username);

    // fetch("/login", {
    //   headers: {
    //     Accept: "application/json, text/plain, */*",
    //     "Content-Type": "application/json",
    //   },
    //   method: "POST",
    //   body: JSON.stringify({ username, password }),
    // })
    //   .then((res) => res.json())
    //   .then((data) => {
    //     console.log(data);
    //     data.role === "Lecturer" ? setlecturerRole(true) : setStudentRole(true);
    //     data.role === "Lecturer"
    //       ? setLecturerData({ username: data.username, role: data.role, user: data.user })
    //       : setStudentData({ username: data.username, role: data.role, user: data.user });
    //   });
  }
  return (
    
    <div>
      <div className="max-w-screen-xl px-4 py-16 mx-auto sm:px-6 lg:px-8">
        <div className="max-w-lg mx-auto">
          <h1 className="text-2xl font-bold text-center text-indigo-600 sm:text-3xl">
            Welcome to Self & Evaluation Portal
          </h1>

          <p className="max-w-md mx-auto mt-4 text-center text-gray-500">
            Login to access to the portal
          </p>

          <form
            action=""
            onSubmit={handleSubmit}
            className="p-8 mt-6 mb-0 space-y-4 rounded-lg shadow-2xl"
          >
            <p className="text-lg font-medium">Sign in to your account</p>

            <div>
              <label htmlFor="email" className="text-sm font-medium">
                Email
              </label>

              <div className="relative mt-1">
                <input
                  type="email"
                  id="email"
                  className="w-full p-4 pr-12 text-sm border-gray-200 rounded-lg shadow-sm"
                  placeholder="Enter email"
                  value={username}
                  onChange={(e) => setUsername(e.target.value)}
                />

                <span className="absolute inset-y-0 inline-flex items-center right-4">
                  <svg
                    xmlns="http://www.w3.org/2000/svg"
                    className="w-5 h-5 text-gray-400"
                    fill="none"
                    viewBox="0 0 24 24"
                    stroke="currentColor"
                  >
                    <path
                      stroke-linecap="round"
                      stroke-linejoin="round"
                      stroke-width="2"
                      d="M16 12a4 4 0 10-8 0 4 4 0 008 0zm0 0v1.5a2.5 2.5 0 005 0V12a9 9 0 10-9 9m4.5-1.206a8.959 8.959 0 01-4.5 1.207"
                    />
                  </svg>
                </span>
              </div>
            </div>

            <div>
              <label htmlFor="password" className="text-sm font-medium">
                Password
              </label>

              <div className="relative mt-1">
                <input
                  type="password"
                  id="password"
                  className="w-full p-4 pr-12 text-sm border-gray-200 rounded-lg shadow-sm"
                  placeholder="Enter password"
                  value={password}
                  onChange={(e) => setPassword(e.target.value)}
                />

                <span className="absolute inset-y-0 inline-flex items-center right-4">
                  <svg
                    xmlns="http://www.w3.org/2000/svg"
                    className="w-5 h-5 text-gray-400"
                    fill="none"
                    viewBox="0 0 24 24"
                    stroke="currentColor"
                  >
                    <path
                      stroke-linecap="round"
                      stroke-linejoin="round"
                      stroke-width="2"
                      d="M15 12a3 3 0 11-6 0 3 3 0 016 0z"
                    />
                    <path
                      stroke-linecap="round"
                      stroke-linejoin="round"
                      stroke-width="2"
                      d="M2.458 12C3.732 7.943 7.523 5 12 5c4.478 0 8.268 2.943 9.542 7-1.274 4.057-5.064 7-9.542 7-4.477 0-8.268-2.943-9.542-7z"
                    />
                  </svg>
                </span>
              </div>
            </div>

            <button
              type="submit"
              className="block w-full px-5 py-3 text-sm font-medium text-white bg-indigo-600 rounded-lg"
              onClick={() => login(username)}
            >
              Sign in
            </button>

            <p className="text-sm text-center text-gray-500">
              No account?
              <a className="underline" href="/">
                Sign up
              </a>
            </p>
          </form>
        </div>
      </div>
      {lecturerData && (
        <div>
          <p>Welcome {!lecturerData ? "Loading..." : lecturerData.username}!</p>
          <p>Role: {!lecturerData ? "Loading..." : lecturerData.role}</p>
          <p>User: {!lecturerData ? "Loading..." : lecturerData.user}</p>
        </div>
      )}
      {studentData && (
        <div>
          <p>Welcome {!studentData ? "Loading..." : studentData.username}!</p>
          <p>Role: {!studentData ? "Loading..." : studentData.role}</p>
          <p>User: {!studentData ? "Loading..." : studentData.user}</p>
        </div>
      )}
    </div>
  );
}

export default Login;
